import React from 'react';
import styled from 'styled-components'

import { AppRouterLink } from '../../../UI/AppRouterLink'
import { AppPercentIcon } from '../../../UI/Icons/AppPercentIcon'
import { AppStarIcon } from '../../../UI/Icons/AppStarIcon'


const RouterLinkText = styled.span`
  margin-top: 5px;
`

export const HeaderMainNav = () => {
  const navLinksData = [
    { name: 'Акции', href: '/stock', IconComponent: AppPercentIcon },
    { name: 'Наш выбор', href: '/stock', IconComponent: AppStarIcon },
  ]

  return (
    <div className="container">
      <div className="row">
        <nav>
          { navLinksData.map((linkData, id) => (
            <AppRouterLink href={ linkData.href } key={ id }>
              { linkData.IconComponent }
              { linkData.name }
            </AppRouterLink>
          )) }
        </nav>
      </div>
    </div>
  )
}
